import React, {Component, Fragment} from 'react';
import '../assets/css/templatemo-stand-blog.css';
import '../assets/css/custom.css';
import '../assets/css/bootstrap.min.css';
import {Container, Row, Col, Navbar, Nav} from 'react-bootstrap';
import {NavLink} from 'react-router-dom'

class Header extends Component{
    render(){
        return(
            <Fragment>
            <header className="">
                <Container>
                    <Row>
                        <Col>
                        <Navbar collapseOnSelect expand="lg" >
                            <Navbar.Brand href="#home"><h2>React Blog<em>.</em></h2></Navbar.Brand>
                            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                            <Navbar.Collapse id="responsive-navbar-nav">
                                <Nav className="mr-auto">
                                </Nav>
                                <Nav>
                                    
<Nav.Link><NavLink exact activeStyle={{color:'#00a8ee'}} className="nav-item" to="/">Home</NavLink></Nav.Link>
<Nav.Link><NavLink exact activeStyle={{color:'#00a8ee'}} className="nav-item" to="/blog">Blog</NavLink></Nav.Link>
<Nav.Link><NavLink exact activeStyle={{color:'#00a8ee'}} className="nav-item" to="/about">About</NavLink></Nav.Link>
<Nav.Link><NavLink exact activeStyle={{color:'#00a8ee'}} className="nav-item" to="/contact">Contact</NavLink></Nav.Link>

                                </Nav>
                            </Navbar.Collapse>
                        </Navbar>
                        </Col>
                    </Row>
                </Container>
            </header>

            </Fragment>
        )
    }
}

export default Header;
